import React from "react";
import Game from "./Game";

const Square = ({ value, games, onClick }) => {
  return (
    <button className="square" onClick={onClick}>
      {value}
      {games.map((map, i) => (
        <Game key={i} value={map} />
      ))}
    </button>
  );
};

export default Square;
